import React from 'react';



export default function Cadastrar() {
    return(
        <div className="cadastrar-container">
           <table id="margem">
                <button id="voltar" onClick="/">Voltar</button>
                <h1>Cadastrar</h1>
                <button>Confirmar</button>
            </table>
        </div>

    );
}
